import React, { Component } from "react";

class NavPage extends Component {
  state = {};
  render() {
    return (
      <div
        style={{
          backgroundColor: "rgba(252, 186, 3, .8)",
          width: 400,
          height: "170vh",
          position: "absolute",
          right: 0,
          zIndex: 1,
        }}
      ></div>
    );
  }
}

export default NavPage;
